import Book from "./Book";
function BookList({ Boook, dispatch, updateBook }) {
  return (
    <>
      {Boook.map((book) => (
        <Book
          key={book.id}
          bookImage={book.bookImage}
          Name={book.Name}
          Author={book.Author}
          Publisher={book.Publisher}
          Avability={book.Avability}
          Ledger={book.Ledger}
          id={book.id}
          updateBook={updateBook}
          dispatch={dispatch}
        />
      ))}
      {/* <div>
          <button >Add Books</button>
          </div> 
          {console.log(addBook)}
           <Form addBook={(book)=>addBook(book)}/> 
           <Form addBook = {addBook}/> */}
    </>
  );
}
export default BookList;
